import React from 'react';
import './style.css'
class ClearAll extends React.Component {

    handleClick(){
        this.props.clearAllMessages(this.state);
    }
	render() {
        return (
            <center>
                <button type="del" onClick = {this.handleClick} id="ClearAll">ClearAll</button>
            </center>
        );
    }
}
export default ClearAll;
